import React from 'react';
import './Tag.scss';

const Tag = (queryLogement) => {
    const logement = queryLogement.logement;
    console.log(logement);

    return (
        <div className='tags'>
            {logement.tags.map((tag, index) => (<p key={index}>{tag}</p>))}
        </div>
    );
};

export default Tag;
